/**
 * @param {string} s
 * @return {number}
 */
var minimumBeautifulSubstrings = function(s) {
    let powersOfFive = new Set();
    let currentPower = 1;
    while (currentPower.toString(2).length <= s.length + 1) {
        powersOfFive.add(currentPower.toString(2));
        currentPower *= 5;
    }

    const dp = new Array(s.length + 1).fill(Infinity);
    dp[0] = 0;

    for (let i = 1; i <= s.length; i++) {
        for (let j = i; j >= 1; j--) {
            if (s[j - 1] === '0') continue;
            let sub = s.substring(j - 1, i);
            if (powersOfFive.has(sub)) {
                dp[i] = Math.min(dp[i], dp[j - 1] + 1);
            }
        }
    }

    return dp[s.length] === Infinity ? -1 : dp[s.length];
};
